AllocatorPtr NPUExecutionProvider::GetAllocator(int id, OrtMemType mem_type) const {
  // Pinned memory allocator is shared between threads, but CUDA memory allocator is per-thread or it may cause result changes
  // A hypothesis is that arena allocator is not aligned with CUDA output cache, and data from different kernel writes may
  // cause cacheline to contain dirty data.
  if (mem_type == OrtMemTypeDefault) {
    return allocator_;
  } else {
    return IExecutionProvider::GetAllocator(id, mem_type);
  }
}

std::vector<std::unique_ptr<ComputeCapability>>
NPUExecutionProvider::GetCapability(const onnxruntime::GraphViewer& graph, const std::vector<const KernelRegistry*>& kernel_registries) const {
  // Find inputs, initializers and outputs for each supported subgraph

  std::vector<NodeIndex> candidates;

  if (!graph.is_partitioned) {
    for (auto& node_index : graph.GetNodesInTopologicalOrder()) {
      const auto* p_node = graph.GetNode(node_index);
      if (p_node == nullptr)
        continue;

      const auto& node = *p_node;
      const KernelCreateInfo* npu_kernel_def = nullptr;
      if (!node.GetExecutionProviderType().empty()) {
        continue;
      }

      for (auto registry : kernel_registries) {
        // LOGS_DEFAULT(WARNING) << "NPU kernel not found in registries for Op type: " << node.OpType() << " node name: " << node.Name();
        auto st = registry->TryFindKernel(node, Type(), &npu_kernel_def);

        // at least one registry has a CUDA kernel for this node
        if (st.IsOK())
          break;
      }

      // none of the provided registries has a CUDA kernel for this node
      if (npu_kernel_def == nullptr) {
        LOGS_DEFAULT(WARNING) << "NPU kernel not found in registries for Op type: " << node.OpType() << " node name: " << node.Name();
        continue;
      } else {
        LOGS_DEFAULT(WARNING) << "NPU kernel : " << node.OpType() << " node name: " << node.Name();
      }
      

      bool not_supported = false;

      auto support_dimension = 4;

      std::string op_name(node.OpType());

      // Case 1.
      if (op_name == "QLinearConv") {
        // X Shape information
        auto X_def = node.InputDefs().at(0);
        auto X_shape = X_def->Shape();

        if (X_shape == nullptr) {
          ORT_NOT_IMPLEMENTED("X Shape is a nullptr. @ npu_execution_provider");
          not_supported = true;
        }

        auto X_dim = X_shape->dim_size();
        if(X_dim != support_dimension) {
          ORT_NOT_IMPLEMENTED("NEOWINE NPU NOT SUPPORT:: SUPPORT ONLY 4 DIM Data. @ npu_execution_provider");
          not_supported = true;
        }

        // W Shape information
        auto W_def = node.InputDefs().at(3);

        auto W_shape = W_def->Shape();
        if(W_shape == nullptr) {
          ORT_NOT_IMPLEMENTED("W Shape is a nullptr. @ npu_execution_provider");
          not_supported = true;
        }

      }
      if (not_supported) {
        LOGS_DEFAULT(WARNING) << "NPU kernel not supported. Fallback to CPU execution provider for Op type: " << node.OpType() << " node name: " << node.Name();
      } else {
        candidates.push_back(node.Index());
      }
    }
  } else {
    for (auto& node : graph.partition_nodes_) {
      candidates.push_back(node->Index());
    }
  }

  std::vector<std::unique_ptr<ComputeCapability>> result;
  for (auto& node_index : candidates) {

    std::unique_ptr<IndexedSubGraph> sub_graph = onnxruntime::make_unique<IndexedSubGraph>();
    sub_graph->nodes.push_back(node_index);
    result.push_back(onnxruntime::make_unique<ComputeCapability>(std::move(sub_graph)));
  }  

  return result;
}

namespace npu {

class ONNX_OPERATOR_TYPED_KERNEL_CLASS_NAME(kNpuExecutionProvider, kOnnxDomain, 10, int8_t, QLinearConv);

template <>
KernelCreateInfo BuildKernelCreateInfo<void>() {
  KernelCreateInfo info;
  return info;
}

static Status RegisterNpuKernels(KernelRegistry& kernel_registry) {
  static const BuildKernelCreateInfoFn function_table[] = {
      BuildKernelCreateInfo<ONNX_OPERATOR_TYPED_KERNEL_CLASS_NAME(kNpuExecutionProvider, kOnnxDomain, 10, int8_t, QLinearConv)>,
  };

  for (auto& function_table_entry : function_table) {
    KernelCreateInfo info = function_table_entry();
    if (info.kernel_def != nullptr) {  // filter disabled entries where type is void
      ORT_RETURN_IF_ERROR(kernel_registry.Register(std::move(info)));
    }
  }
  return Status::OK();
}

KernelRegistryAndStatus GetNpuKernelRegistry() {
  KernelRegistryAndStatus ret;
  ret.st = RegisterNpuKernels(*ret.kernel_registry);
  return ret;
}

} // namespace npu

std::shared_ptr<KernelRegistry>
NPUExecutionProvider::GetKernelRegistry() const {
  static KernelRegistryAndStatus k = onnxruntime::npu::GetNpuKernelRegistry();
  // throw if the registry failed to initialize
  ORT_THROW_IF_ERROR(k.st);
  return k.kernel_registry;
}

std::unique_ptr<onnxruntime::IDataTransfer> NPUExecutionProvider::GetDataTransfer() const {
  return onnxruntime::make_unique<onnxruntime::NPUDataTransfer>();
}



}  // namespace onnxruntime

