### Describe the issue

I have a multi-threading application in C++ and I need to create a shared environment to share with the sessions. I have 8 threads and each one must have its own session the use the shared env and each session have the exactly same neural network.

I have create the environment to share with the sessions following the examples in [onnxruntime examples](https://github.com/microsoft/onnxruntime/blob/main/onnxruntime/test/shared_lib/test_inference.cc) like this:

```  
