    std::unique_ptr<OrtArenaCfg, decltype( Ort::GetApi().ReleaseArenaCfg )> rel_arena_cfg( arena_cfg, Ort::GetApi().ReleaseArenaCfg );

    OrtCUDAProviderOptions cuda_provider_options;
    cuda_provider_options.default_memory_arena_cfg = arena_cfg;
    m_SessionOptions->AppendExecutionProvider_CUDA( cuda_provider_options );

    Ort::GetApi().CreateAndRegisterAllocator( (OrtEnv*) ( *m_Env ), m_MemoryInfo, arena_cfg );
```

Then I created a vector of sessions where each thread, at the start will take one of the 8 sessions:

```
if ( m_vecSessions.empty() )
{
    for ( int i = 0; i < m_NumThreads; ++i )
    {
        if ( m_profiler == 1 )
        {
              std::wstring str_ProfileName = L'PROFILE_ONNX_MAIN_thr0' + std::to_string( i );
              m_SessionOptions->EnableProfiling( str_ProfileName.c_str() );
         }
         m_vecSessions.push_back( std::make_pair<Ort::Session, bool>( Ort::Session( *m_Env, stdModelName.c_str(), *m_SessionOptions ), false ) );
     }
}
```

when i run my project, every now and then, not always, i get the error in photo when I run:
`m_vecSessions.push_back( std::make_pair<Ort::Session, bool>( Ort::Session( *m_Env, stdModelName.c_str(), *m_SessionOptions ), false ) );`


This happens especially after some time the project is run in release or in debug, both from .exe and on visual studio and only with CUDA.
With the CPU everything works fine.
Does anyone know what could be the cause or how to fix it?


