### Describe the issue

SessionOptions in ORTW is missing the ability to set free dimensions. This matters for performance, as models like Stable Diffusion can benefit from all the constant folding and shape inference. Without it, execution providers like WebNN can end up falling back to the CPU provider when operator shapes cannot be computed opportunistically.
https://github.com/microsoft/onnxruntime/blob/b7fd5af48bcad76466b67dcd95dfc78a0bb469b2/js/common/lib/inference-session.ts#L46-L162

### To reproduce

Try to load any model with free dimensions in ORTW, and there is no way to pass the named dimensions. e.g. Presume a `namedFreeDimensionOverrides` attribute existed:

            const sessionOptions =
            {
                executionProviders: [{name: "webnn", deviceType: 'gpu', powerPreference: 'high-performance' }],
                namedFreeDimensionOverrides: {"batch_size": 2, "height": 64, "width": 64 ...},
            };

            options.logSeverityLevel = 0;
            options.logVerbosityLevel = 3;

            const sess = await ort.InferenceSession.create(modelPath, sessionOptions);

